(0x018d8b4e74907a1aaa2849b35cb406f5, 0x0fa91ce3e96a4bc2be4bd9ce752c3425, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, '{\"content\": {\"value\": \"<span data-metadata=\\\"<!--(figmeta)eyJmaWxlS2V5IjoidG5EM2hienhmd2VlNVdxMVJaOGdWeCIsInBhc3RlSUQiOjE1NDAxNDU1NDQsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\\\"></span><span data-buffer=\\\"<!--(figma)(/figma)-->\\\"></span><h1><span style=\\\"white-space:pre-wrap;\\\">Weighing in at 2,749 pounds, Giengers pumpkin not only won the championship, it broke the previous world record.</span></h1>\", \"source\": \"static\"}, \"verticalAlign\": {\"value\": null, \"source\": \"static\"}}', NULL, '2024-02-09 00:44:04.200', '2024-02-09 01:23:24.968');
INSERT INTO `cms_slot_translation` (`cms_slot_id`, `cms_slot_version_id`, `language_id`, `config`, `custom_fields`, `created_at`, `updated_at`) VALUES
(0x018d8b4e74907a1aaa2849b4e837c086, 0x0fa91ce3e96a4bc2be4bd9ce752c3425, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, '{\"content\": {\"value\": \"<span data-metadata=\\\"<!--(figmeta)eyJmaWxlS2V5IjoidG5EM2hienhmd2VlNVdxMVJaOGdWeCIsInBhc3RlSUQiOjIwMzMwMzEwNjcsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\\\"></span><span data-buffer=\\\"<!--(figma)(/figma)-->\\\"></span><span style=\\\"white-space:pre-wrap;\\\">On October 9, 2023, Travis Gienger used the help of a crane to carefully place a massive gourd on the scale at the 50th World Championship Pumpkin Weigh-Off in Half Moon Bay in California.</span>\", \"source\": \"static\"}, \"verticalAlign\": {\"value\": null, \"source\": \"static\"}}', NULL, '2024-02-09 00:44:04.247', NULL);
INSERT INTO `cms_slot_translation` (`cms_slot_id`, `cms_slot_version_id`, `language_id`, `config`, `custom_fields`, `created_at`, `updated_at`) VALUES
(0x018d8b4e74907a1aaa2849b5328af0ed, 0x0fa91ce3e96a4bc2be4bd9ce752c3425, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, '{\"content\": {\"value\": \"<span data-metadata=\\\"<!--(figmeta)eyJmaWxlS2V5IjoidG5EM2hienhmd2VlNVdxMVJaOGdWeCIsInBhc3RlSUQiOjE1MDY2NTg2MywiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->\\\"></span><span data-buffer=\\\"<!--(figma)(/figma)-->\\\"></span><span style=\\\"white-space:pre-wrap;\\\">With a passion for horticulture that dates back 30 years, this wasnt the first pumpkin hed grown in a patch. But early on, he knew it was special. As it began to grow perfectly round like a basketballand being that it was 2023 he aptly named the giant pumpkin Michael Jordan, after the greatest<br>basketball player of all time.</span>\", \"source\": \"static\"}, \"verticalAlign\": {\"value\": null, \"source\": \"static\"}}', NULL, '2024-02-09 00:44:04.261', NULL),
