(0x018d8b3be40b7394868c17b392b4210a, 0x018d8b3ba9f870418ef4bd64479ce5a4, '{{ salesChannel.name }}', 'Password zurcksetzen - {{ salesChannel.name }}', 'Anfrage zum Zurcksetzen des Passworts', '<div style=\"font-family:arial; font-size:12px;\">\n    <p>\n        Hallo {{ customer.salutation.translated.letterName }} {{customer.firstName}} {{ customer.lastName }},<br/>\n        <br/>\n        im Shop {{ salesChannel.translated.name }} wurde eine Anfrage gestellt, um Ihr Passwort zurck zu setzen.\n        Bitte besttigen Sie den unten stehenden Link, um ein neues Passwort zu definieren.<br/>\n        <br/>\n        <a href=\"{{ resetUrl }}\">Passwort zurcksetzen</a><br/>\n        <br/>\n        Dieser Link ist nur fr die nchsten 2 Stunden gltig. Danach muss das Zurcksetzen des Passwortes erneut beantragt werden.\n        Falls Sie Ihr Passwort nicht zurcksetzen mchten, ignorieren Sie diese E-Mail - es wird dann keine nderung vorgenommen.\n    </p>\n</div>', 'Hallo {{ customer.salutation.translated.letterName }} {{customer.firstName}} {{ customer.lastName }},\n\nim Shop {{ salesChannel.translated.name }} wurde eine Anfrage gestellt, um Ihr Passwort zurck zu setzen.\nBitte besttigen Sie den unten stehenden Link, um ein neues Passwort zu definieren.\n\nPasswort zurcksetzen: {{ resetUrl }}\n\nDieser Link ist nur fr die nchsten 2 Stunden gltig. Danach muss das Zurcksetzen des Passwortes erneut beantragt werden.\nFalls Sie Ihr Passwort nicht zurcksetzen mchten, ignorieren Sie diese E-Mail - es wird dann keine nderung vorgenommen.', NULL, '2024-02-09 00:19:34.576', NULL),
(0x018d8b3be40b7394868c17b392b4210a, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, '{{ salesChannel.name }}', 'Password reset - {{ salesChannel.name }}', 'Password reset request', '<div style=\"font-family:arial; font-size:12px;\">\n    <p>\n        {{ customer.salutation.translated.letterName }} {{ customer.firstName }} {{ customer.lastName }},<br/>\n        <br/>\n        there has been a request to reset you Password in the Shop {{ salesChannel.translated.name }}\n        Please confirm the link below to specify a new password.<br/>\n        <br/>\n        <a href=\"{{ resetUrl }}\">Reset password</a><br/>\n        <br/>\n        This link is valid for the next 2 hours. After that you have to request a new confirmation link.<br/>\n        If you do not want to reset your password, please ignore this email. No changes will be made.\n    </p>\n</div>\n', '{{ customer.salutation.translated.letterName }} {{customer.firstName}} {{ customer.lastName }},\n\nthere has been a request to reset you Password in the Shop {{ salesChannel.translated.name }}\nPlease confirm the link below to specify a new password.\n\nReset password: {{ resetUrl }}\n\nThis link is valid for the next 2 hours. After that you have to request a new confirmation link.\nIf you do not want to reset your password, please ignore this email. No changes will be made.', NULL, '2024-02-09 00:19:34.545', NULL),
(0x018d8b3be44d72c3bc8a7681de29bebd, 0x018d8b3ba9f870418ef4bd64479ce5a4, '{{ salesChannel.name }}', 'Ihr Hndleraccount wurde freigeschaltet - {{ salesChannel.name }}', 'Kundengruppenwechsel freigeschaltet', '<div style=\"font-family:arial; font-size:12px;\">\n    <p>\n        Hallo,<br/>\n        <br/>\n        ihr Hndlerkonto bei {{ salesChannel.translated.name }} wurde freigeschaltet.<br/>\n        Von nun an werden wir Ihnen den Netto-Preis berechnen.\n    </p>\n</div>\n', 'Hallo,\n\nihr Hndlerkonto bei {{ salesChannel.translated.name }} wurde freigeschaltet.\nVon nun an werden wir Ihnen den Netto-Preis berechnen.\n', NULL, '2024-02-09 00:19:34.643', NULL),
(0x018d8b3be44d72c3bc8a7681de29bebd, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, '{{ salesChannel.name }}', 'Your merchant account has been unlocked - {{ salesChannel.name }}', 'Customer Group Change accepted', '<div style=\"font-family:arial; font-size:12px;\">\n    <p>\n        Hello,<br/>\n        <br/>\n        your merchant account at {{ salesChannel.translated.name }} has been unlocked.<br/>\n        From now on, we will charge you the net purchase price.\n    </p>\n</div>\n', 'Hello,\n\nyour merchant account at {{ salesChannel.translated.name }} has been unlocked.\nFrom now on, we will charge you the net purchase price.\n', NULL, '2024-02-09 00:19:34.608', NULL),
(0x018d8b3be47e70dba52415d528d3929a, 0x018d8b3ba9f870418ef4bd64479ce5a4, '{{ salesChannel.name }}', 'Ihr Hndleraccountantrag wurde abgelehnt - {{ salesChannel.name }}', 'Kundengruppenwechsel abgelehnt', '<div style=\"font-family:arial; font-size:12px;\">\n    <p>\n        Hallo,<br/>\n        <br/>\n        vielen Dank fr ihr Interesse an unseren Grohandelspreisen. Leider liegt uns bisher keine <br/>\n        Hndlerauthentifizierung vor, und daher knnen wir Ihre Anfrage nicht besttigen. <br/>\n        Bei weiteren Fragen kontaktieren Sie uns gerne per Telefon, Fax oder E-Mail. <br/>\n    </p>\n</div>\n', 'Hallo,\n\nvielen Dank fr ihr Interesse an unseren Grohandelspreisen. Leider liegt uns bisher keine\nHndlerauthentifizierung vor, und daher knnen wir Ihre Anfrage nicht besttigen.\nBei weiteren Fragen kontaktieren Sie uns gerne per Telefon, Fax oder E-Mail.\n', NULL, '2024-02-09 00:19:34.688', NULL),
(0x018d8b3be47e70dba52415d528d3929a, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, '{{ salesChannel.name }}', 'Your trader account has not been accepted - {{ salesChannel.name }}', 'Customer Group Change rejected', '<div style=\"font-family:arial; font-size:12px;\">\n    <p>\n        Hello,<br/>\n        <br/>\n        thank you for your interest in our trade prices.\n        Unfortunately, we do not have a trading license yet so that we cannot accept you as a merchant.<br/>\n        In case of further questions please do not hesitate to contact us via telephone, fax or email.\n    </p>\n</div>\n', 'Hello,\n\nthank you for your interest in our trade prices. Unfortunately,\nwe do not have a trading license yet so that we cannot accept you as a merchant.\nIn case of further questions please do not hesitate to contact us via telephone, fax or email.\n', NULL, '2024-02-09 00:19:34.677', NULL),
(0x018d8b3c03c270c7a0bc47766ff849da, 0x018d8b3ba9f870418ef4bd64479ce5a4, 'Shopware Administration', 'Password-Wiederherstellung', '', '<div style=\"font-family:arial; font-size:12px;\">\n    <p>\n        Hallo {{ userRecovery.user.firstName }} {{ userRecovery.user.lastName }},<br/>\n        <br/>\n        es wurde eine Anfrage gestellt, um Ihr Passwort zurck zu setzen.\n        Bitte besttigen Sie den unten stehenden Link, um ein neues Passwort zu definieren.<br/>\n        <br/>\n        <a href=\"{{ resetUrl }}\">Passwort zurcksetzen</a><br/>\n        <br/>\n        Dieser Link ist nur fr die nchsten 2 Stunden gltig. Danach muss das Zurcksetzen des Passwortes erneut beantragt werden.\n        Falls Sie Ihr Passwort nicht zurcksetzen mchten, ignorieren Sie diese E-Mail - es wird dann keine nderung vorgenommen.\n    </p>\n</div>', '        Hallo {{ userRecovery.user.firstName }} {{ userRecovery.user.lastName }},\n\n        es wurde eine Anfrage gestellt, um Ihr Passwort zurck zu setzen.\n        Bitte besttigen Sie den unten stehenden Link, um ein neues Passwort zu definieren.\n\n        Passwort zurcksetzen: {{ resetUrl }}\n\n        Dieser Link ist nur fr die nchsten 2 Stunden gltig. Danach muss das Zurcksetzen des Passwortes erneut beantragt werden.\n        Falls Sie Ihr Passwort nicht zurcksetzen mchten, ignorieren Sie diese E-Mail - es wird dann keine nderung vorgenommen.', NULL, '2024-02-09 00:19:42.687', NULL),
(0x018d8b3c03c270c7a0bc47766ff849da, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, 'Shopware Administration', 'Password recovery', '', '<div style=\"font-family:arial; font-size:12px;\">\n    <p>\n        Dear {{ userRecovery.user.firstName }} {{ userRecovery.user.lastName }},<br/>\n        <br/>\n        there has been a request to reset your password.\n        Please confirm the link below to specify a new password.<br/>\n        <br/>\n        <a href=\"{{ resetUrl }}\">Reset password</a><br/>\n        <br/>\n        This link is valid for the next 2 hours. After that you have to request a new confirmation link.<br/>\n        If you do not want to reset your password, please ignore this email. No changes will be made.\n    </p>\n</div>', '        Dear {{ userRecovery.user.firstName }} {{ userRecovery.user.lastName }},\n\n        there has been a request to reset your password.\n        Please confirm the link below to specify a new password.\n\n        Reset password: {{ resetUrl }}\n\n        This link is valid for the next 2 hours. After that you have to request a new confirmation link.\n        If you do not want to reset your password, please ignore this email. No changes will be made.', NULL, '2024-02-09 00:19:42.684', NULL),
(0x018d8b3c1b9a738db4b86a632b96a601, 0x018d8b3ba9f870418ef4bd64479ce5a4, '{{ salesChannel.name }}', 'Kontaktanfrage erhalten - {{ salesChannel.name }}', 'Kontaktanfrage erhalten', '<div style=\"font-family:arial; font-size:12px;\">\n    <p>\n        Folgende Nachricht wurde an Sie via Kontakt-Formular gesendet.<br/>\n        <br/>\n        Name: {{ contactFormData.firstName }} {{ contactFormData.lastName }}\n        <br/>\n        Kontakt E-Mail: {{ contactFormData.email }}<br/>\n        <br>\n        Telefonnummer: {{ contactFormData.phone }}<br/>\n        <br/>\n        Betreff: {{ contactFormData.subject }}<br/>\n        <br/>\n        Message:<br/>\n        {{ contactFormData.comment|nl2br }}<br/>\n    </p>\n</div>\n', 'Folgende Nachricht wurde an Sie via Kontakt-Formular gesendet.\n\nName: {{ contactFormData.firstName }} {{ contactFormData.lastName }}\nKontakt E-Mail: {{ contactFormData.email }}\n\nTelefonnummer: {{ contactFormData.phone }}\n\nBetreff: {{ contactFormData.subject }}\n\nNachricht:\n{{ contactFormData.comment }}\n', NULL, '2024-02-09 00:20:23.000', NULL),
(0x018d8b3c1b9a738db4b86a632b96a601, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, '{{ salesChannel.name }}', 'Contact form received - {{ salesChannel.name }}', 'Contact form received', '<div style=\"font-family:arial; font-size:12px;\">\n    <p>\n        The following Message was sent to you via the contact form.<br/>\n        <br/>\n        Contact name: {{ contactFormData.firstName }} {{ contactFormData.lastName }}\n        <br/>\n        Contact email address: {{ contactFormData.email }}\n        <br/>\n        Phone: {{ contactFormData.phone }}<br/>\n        <br/>\n        Subject: {{ contactFormData.subject }}<br/>\n        <br/>\n        Message:<br/>\n        {{ contactFormData.comment|nl2br }}<br/>\n    </p>\n</div>\n', 'The following Message was sent to you via the contact form.\n\nContact name: {{ contactFormData.firstName }} {{ contactFormData.lastName }}\nContact email address: {{ contactFormData.email }}\nPhone: {{ contactFormData.phone }}\n\nSubject: {{ contactFormData.subject }}\n\nMessage:\n{{ contactFormData.comment }}\n', NULL, '2024-02-09 00:19:48.764', NULL),
(0x018d8b3c26c17385ad8a3ef7e1dcce1e, 0x018d8b3ba9f870418ef4bd64479ce5a4, '{{ shopName }}', 'Password-Wiederherstellung', '', '<div style=\"font-family:arial; font-size:12px;\">\n    <p>\n        Hallo {{ customerRecovery.customer.firstName }} {{ customerRecovery.customer.lastName }},<br/>\n        <br/>\n        Sie haben ein neues Passwort fr Ihren {{ shopName }}-Account angefordert.\n        Klicken Sie auf folgenden Link, um Ihr Passwort zurckzusetzen:<br/>\n        <br/>\n        <a href=\"{{ resetUrl }}\">{{ resetUrl }}</a><br/>\n        <br/>\n        Dieser Link ist fr die nchsten 2 Stunden gltig.\n        Falls Sie Ihr Passwort nicht zurcksetzen mchten, ignorieren Sie diese E-Mail - es wird dann keine nderung vorgenommen.<br/>\n        <br/>\n        Mit freundlichen Gren\n        Ihr {{ shopName }}-Team\n    </p>\n</div>', '        Hallo {{ customerRecovery.customer.firstName }} {{ customerRecovery.customer.lastName }},\n\n        Sie haben ein neues Passwort fr Ihren {{ shopName }}-Account angefordert.\n        Klicken Sie auf folgenden Link, um Ihr Passwort zurckzusetzen:\n\n        {{ resetUrl }}\n\n        Dieser Link ist fr die nchsten 2 Stunden gltig.\n        Falls Sie Ihr Passwort nicht zurcksetzen mchten, ignorieren Sie diese E-Mail - es wird dann keine nderung vorgenommen.\n\n        Mit freundlichen Gren\n        Ihr {{ shopName }}-Team', NULL, '2024-02-09 00:19:51.638', NULL),
(0x018d8b3c26c17385ad8a3ef7e1dcce1e, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, '{{ shopName }}', 'Password recovery', '', '<div style=\"font-family:arial; font-size:12px;\">\n    <p>\n        Hello {{ customerRecovery.customer.firstName }} {{ customerRecovery.customer.lastName }},<br/>\n        <br/>\n        You have requested a new password for your {{ shopName }} account.\n        Click on the following link to reset your password:<br/>\n        <br/>\n        <a href=\"{{ resetUrl }}\">{{ resetUrl }}</a><br/>\n        <br/>\n        This link is valid for the next 2 hours.\n        If you don\'t want to reset your password, ignore this email and no changes will be made.<br/>\n        <br/>\n        Yours sincerely\n        Your {{ shopName }} team\n    </p>\n</div>', '        Hello {{ customerRecovery.customer.firstName }} {{ customerRecovery.customer.lastName }},\n\n        You have requested a new password for your {{ shopName }} account.\n        Click on the following link to reset your password:\n\n        {{ resetUrl }}\n\n        This link is valid for the next 2 hours.\n        If you don\'t want to reset your password, ignore this email and no changes will be made.\n\n        Yours sincerely\n        Your {{ shopName }}-Team', NULL, '2024-02-09 00:19:51.625', NULL),
(0x018d8b3c328f70aaab056caa53ba2ecf, 0x018d8b3ba9f870418ef4bd64479ce5a4, '{{ salesChannel.name }}', 'Bestellung bei {{ salesChannel.name }} wurde teilweise ausgeliefert', 'Shopware Basis Template', '<div style=\"font-family:arial; font-size:12px;\">\n    <br/>\n    <p>\n        {% if order.orderCustomer.salutation %}{{ order.orderCustomer.salutation.translated.letterName ~ \' \' }}{% endif %}{{ order.orderCustomer.firstName }} {{ order.orderCustomer.lastName }},<br/>\n        <br/>\n        der Lieferstatus fr Ihre Bestellung bei {{ salesChannel.translated.name }} (Number: {{ order.orderNumber }}) vom {{ order.orderDateTime|format_datetime(\'medium\', \'short\', locale=\'de-DE\') }} hat sich gendert.<br/>\n        <strong>Die Bestellung hat jetzt den Lieferstatus: {{ order.deliveries.first.stateMachineState.translated.name }}.</strong><br/>\n        <br/>\n        Den aktuellen Status Ihrer Bestellung knnen Sie auch jederzeit auf unserer Webseite im  Bereich \"Mein Konto\" - \"Meine Bestellungen\" abrufen: {{ rawUrl(\'frontend.account.order.single.page\', { \'deepLinkCode\': order.deepLinkCode }, salesChannel.domains|first.url) }}\n        </br>\n        Sollten Sie allerdings den Kauf ohne Registrierung, also ohne Anlage eines Kundenkontos, gewhlt haben, steht Ihnen diese Mglichkeit nicht zur Verfgung.\n    </p>\n</div>\n', '{% if order.orderCustomer.salutation %}{{ order.orderCustomer.salutation.translated.letterName ~ \' \' }}{% endif %}{{ order.orderCustomer.firstName }} {{ order.orderCustomer.lastName }},\n\nder Lieferstatus fr Ihre Bestellung bei {{ salesChannel.translated.name }} (Number: {{ order.orderNumber }}) vom {{ order.orderDateTime|format_datetime(\'medium\', \'short\', locale=\'de-DE\') }} hat sich gendert!\nDie Bestellung hat jetzt den Lieferstatus: {{ order.deliveries.first.stateMachineState.translated.name }}.\n\nDen aktuellen Status Ihrer Bestellung knnen Sie auch jederzeit auf unserer Webseite im  Bereich \"Mein Konto\" - \"Meine Bestellungen\" abrufen: {{ rawUrl(\'frontend.account.order.single.page\', { \'deepLinkCode\': order.deepLinkCode }, salesChannel.domains|first.url) }}\nSollten Sie allerdings den Kauf ohne Registrierung, also ohne Anlage eines Kundenkontos, gewhlt haben, steht Ihnen diese Mglichkeit nicht zur Verfgung.\n', NULL, '2024-02-09 00:19:54.656', NULL);
