INSERT INTO `product_translation` (`product_id`, `product_version_id`, `language_id`, `meta_description`, `name`, `keywords`, `description`, `meta_title`, `pack_unit`, `custom_fields`, `slot_config`, `created_at`, `updated_at`, `pack_unit_plural`, `custom_search_keywords`) VALUES
(0x018d8b4596f9733d82d5ace79b5a5f4f, 0x0fa91ce3e96a4bc2be4bd9ce752c3425, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, NULL, 'Jack O lantern', NULL, 'The 2,749 Pound World Record Pumpkin was nicknamed, Michael Jordan, because the year #23 and believe it or not it did actually start off basketball round. This pumpkin was incredibly heavy and had dense thick walls. The pumpkin grew very quickly to a WR 211 circumference. Michael Jordan was crossed with my Godzilla pumpkin that was the fastest growing pumpkin I have ever seen. It was still packing on 43 pounds a day when it went down to a tiny rib split mid August. We weighed that pumpkin on an official scale at 2,222 pounds. The cross of these two pumpkins is sure to be a hit. In the right hands I see a 3,000 pound award winning giant pumpkin next year!', NULL, NULL, '{\"custom_product_meta_subtitle\": \"2,749 pounds Jack O lantern (2023 WR Heaviest)\"}', '[]', '2024-02-09 00:31:26.863', '2024-02-15 23:40:00.917', NULL, NULL),
(0x018d8b482d767178b6f2990395457b03, 0x0fa91ce3e96a4bc2be4bd9ce752c3425, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, NULL, 'Tiger King', NULL, 'The 2350 was the largest pumpkin grown in North America for 2020 at 2,350 pounds. The interesting thing about it was it went on to produce numerous Howard Dill awards for bright orange, perfect shaped pumpkins. There were several 2000 pounders and also some that were very close to 2,000 pounds. Most were beautiful orange. If you are looking for a pumpkin that not only grows huge but is a perfect porch looking pumpkin, this is it!', NULL, NULL, '{\"custom_product_meta_subtitle\": \"2350 pound Tiger King\"}', '[]', '2024-02-09 00:32:59.907', '2024-02-16 08:22:58.647', NULL, NULL),
(0x018d8b486dd873d684abeee38295e41d, 0x0fa91ce3e96a4bc2be4bd9ce752c3425, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, NULL, 'Maverick', NULL, 'The 2,560 was the new North American Record and still currently the second biggest pumpkin ever grown in the Western Hemisphere right behind my world record.  The interesting thing about this seed is that it wasnt planted by many growers its first year but finished #2, and #3 in North America this year.  The amount of growers who have requested this seed now is incredible!  It is an 1885 Werner x1885 Werner known for its fast growing genetics and overall large giant pumpkin size.  I cannot wait to see what this pumpkin seed does in some of the best growers hands this year!', NULL, NULL, '{\"custom_product_meta_subtitle\": \"2560 Gienger 1885.5 Werner x sibbed (1885.5 Werner) \"}', '[]', '2024-02-09 00:33:16.326', '2024-02-16 08:23:31.569', NULL, NULL),
(0x018d8b48a63272d383c3f06ba3ca44ca, 0x0fa91ce3e96a4bc2be4bd9ce752c3425, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, NULL, 'Godzilla', NULL, 'The 2,222 pound Godzilla still stings a bit for me.  What could have been we will never know.  This pumpkin was pollinated on a random tertiary side vine and grew very quickly.  Once it hit 2,000 pounds it didnt quit and was still growing an incredible 43 pounds a day.  This pumpkin went down to a tiny rib split mid August weighing in at 2,222 pounds with nearly two months left in its tank.  This seed is my number 1 pick for 3000 pounds next year.  Great color and adding in the brick genetics of the world record is sure to be a hit.  This was the only pumpkin in the world that got crossed with the World Record pumpkin.', NULL, NULL, '{\"custom_product_meta_subtitle\": \"2,222Dmg Gienger-2365 Wolf x sibbed (2365 Wolf, WR) \"}', '[]', '2024-02-09 00:33:30.730', '2024-02-16 08:15:03.868', NULL, NULL),
(0x018d8b48e1ca714bbb9cb225a52b58a9, 0x0fa91ce3e96a4bc2be4bd9ce752c3425, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, NULL, 'Michael Jordan', NULL, 'The 2,749 Pound World Record Pumpkin was nicknamed, Michael Jordan, because the year #23 and believe it or not it did actually start off basketball round.  This pumpkin was incredibly heavy and had dense thick walls.  The pumpkin grew very quickly to a WR 211 circumference.  Michael Jordan was crossed with my Godzilla pumpkin that was the fastest growing pumpkin I have ever seen.  It was still packing on 43 pounds a day when it went down to a tiny rib split mid August.  We weighed that pumpkin on an official scale at 2,222 pounds.  The cross of these two pumpkins is sure to be a hit.  In the right hands I see a 3,000 pound award winning giant pumpkin next year!', NULL, NULL, '{\"custom_product_meta_subtitle\": \"2,749 Gienger-2365 Wolf x sibbed(2365 Wolf,Godzilla) \"}', '[]', '2024-02-09 00:33:45.989', '2024-02-16 08:14:28.507', NULL, NULL),
(0x018d8b4946727c39b30e71e8fd790fde, 0x0fa91ce3e96a4bc2be4bd9ce752c3425, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, NULL, 'Consultation Service', NULL, 'The 2,749 Pound World Record Pumpkin was nicknamed, Michael Jordan, because the year #23 and believe it or not it did actually start off basketball round. This pumpkin was incredibly heavy and had dense thick walls. The pumpkin grew very quickly to a WR 211 circumference. Michael Jordan was crossed with my Godzilla pumpkin that was the fastest growing pumpkin I have ever seen. It was still packing on 43 pounds a day when it went down to a tiny rib split mid August. We weighed that pumpkin on an official scale at 2,222 pounds. The cross of these two pumpkins is sure to be a hit. In the right hands I see a 3,000 pound award winning giant pumpkin next year!', NULL, NULL, NULL, '[]', '2024-02-09 00:35:40.903', '2024-02-09 05:53:39.117', NULL, NULL);

